import React, { Component } from 'react';
import { Link } from "react-router-dom";
import { Form, Button, Container } from 'react-bootstrap';
import validator from "validator";

class PartnerRegister extends Component {

  state = {
    step: 1,
    email: '',
    fullname: '', 
    password: '',
    dob: '',
    gender: '',
    num: '',
    levelOfEducation: '',
    citizenship: '',
    address: '',
    country: '',
    postalcode:''
}

    render() {
      const {step, email, fullname, password, dob, gender, num, levelOfEducation, citizenship, address, country, postalcode} = this.state;
      const inputValues = {  email, fullname, password, dob, gender, num, levelOfEducation, citizenship, address, country, postalcode };
  
        return (
        <Container>
            <h1>This is the Youth Register page</h1>
            <br></br>
            <Form>
                <Form.Group controlId="formEmail" style={{ marginTop: 10 }} >
                    <Form.Label className="label">Email Address</Form.Label>
                    <Form.Control style={{ width: 300 }}
                        type="email"
                        defaultValue={this.props.inputValues.email}
                        name="email"
                        required
                        onChange={this.props.handleChange}
                    />
                </Form.Group>

                <Form.Group controlId="formFullName" style={{ marginTop: 10 }}>
                    <Form.Label className="label">Full Name</Form.Label>
                    <Form.Control
                        type="text"
                        defaultValue={this.props.inputValues.fullname}
                        name="fullname"
                        required
                        onChange={this.props.handleChange}
                    />
                </Form.Group>


                <Form.Group controlId="formPassword" style={{ marginTop: 10 }}>
                    <Form.Label className="label">Password</Form.Label>
                    <Form.Control
                        type="password"
                        defaultValue={this.props.inputValues.password}
                        name="password"
                        required
                        minlength="8"
                        onChange={this.props.handleChange}
                    />
                </Form.Group>

                <Button type="submit" variant="primary" onClick={this.saveAndContinue} style={{ marginTop: 25, marginLeft: 120}}>Next</Button>

            </Form>
    
            <Link to="../Login/login" style={{ marginTop: 20 }}>Already a Youth?</Link>

        </Container>
        );
    }
}

export default PartnerRegister;
